func TestPazzzEngine(t *testing.T) {
	for i, c := range cases {
		s := Salt(c.login, c.site, c.length)

		e, err := Entropy(s, []byte(c.secret))
		if err != nil {
			t.Errorf("could not generate entropy: %s", err.Error())
		}

		rules := Rules(c.lowercase, c.upperase, c.digits, c.symbols)

		got := string(Pass(e, *rules, c.length))

		if got != c.want {
			t.Errorf("case %d: got %s is not equal to want %s.", i, got, c.want)
		}
	}
}
